import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Page1 from './components/Page1/Page1';
import Page2 from './components/Page2/Page2';
import React from 'react'

function App() {
  const [cname, setcname] = React.useState('');
  function handleChange(val){
    setcname(val);
  }
  return (
    <>
      <div className="App">
        <div className='outermainpg'>
          <div className='uppermainpg'>
            Hello {cname} !
          </div>
          <div className='lowermainpg'>
            <BrowserRouter>
              <Routes>
                <Route path='/' element={<Page1 cname={cname} handleChange={()=>{handleChange()}}/>}></Route>
                <Route path='/select' element={<Page2 />}></Route>
              </Routes>
            </BrowserRouter>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
